org\/wiki\/1492_%D0%B3%D0%BE%D0%B4\" title=\"1492 \u0433\u043e\u0434\">1492<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1,_%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%BE%D1%84%D0%BE%D1%80\" title=\"\u041a\u043e\u043b\u0443\u043c\u0431, \u0425\u0440\u0438\u0441\u0442\u043e\u0444\u043e\u0440\">\u041a\u043e\u043b\u0443\u043c\u0431<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432\u044b\u0441\u0430\u0434\u0438\u043b\u0441\u044f \u043d\u0430 \u0431\u0435\u0440\u0435\u0433 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D1%8B%D0%B9_%D0%A1%D0%B2%D0%B5%D1%82_(%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0)\" class=\"mw-redirect\" title=\"\u041d\u043e\u0432\u044b\u0439 \u0421\u0432\u0435\u0442 (\u0410\u043c\u0435\u0440\u0438\u043a\u0430)\">\u041d\u043e\u0432\u043e\u0433\u043e \u0421\u0432\u0435\u0442\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD-%D0%A1%D0%B0%D0%BB%D1%8C%D0%B2%D0%B0%D0%B4%D0%BE%D1%80_(%D0%91%D0%B0%D0%B3%D0%B0%D0%BC%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0)\" title=\"\u0421\u0430\u043d-\u0421\u0430\u043b\u044c\u0432\u0430\u0434\u043e\u0440 (\u0411\u0430\u0433\u0430\u043c\u0441\u043a\u0438\u0435 \u043e\u0441\u0442\u0440\u043e\u0432\u0430)\">\u043e\u0441\u0442\u0440\u043e\u0432 \u0421\u0430\u043d-\u0421\u0430\u043b\u044c\u0432\u0430\u0434\u043e\u0440<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1534_%D0%B3%D0%BE%D0%B4\" title=\"1534 \u0433\u043e\u0434\">1534<\/a>&#160;\u2014 \u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_III_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u041f\u0430\u0432\u0435\u043b III (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u041f\u0430\u0432\u0435\u043b III<\/a> \u0432\u0441\u0442\u0443\u043f\u0438\u043b \u043d\u0430 \u043f\u0440\u0435\u0441\u0442\u043e\u043b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1644_%D0%B3%D0%BE%D0%B4\" title=\"1644 \u0433\u043e\u0434\">1644<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D1%82%D1%81%D0%BA%D0%BE-%D1%88%D0%B2%D0%B5%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1643%E2%80%941645)\" title=\"\u0414\u0430\u0442\u0441\u043a\u043e-\u0448\u0432\u0435\u0434\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1643\u20141645)\">\u0414\u0430\u0442\u0441\u043a\u043e-\u0448\u0432\u0435\u0434\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0439 \u0448\u0432\u0435\u0434\u0441\u043a\u043e-\u0433\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u0439 \u0444\u043b\u043e\u0442 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D1%8C,_%D0%9A%D0%B0%D1%80%D0%BB-%D0%93%D1%83%D1%81%D1%82%D0%B0%D0%B2\" title=\"\u0412\u0440\u0430\u043d\u0433\u0435\u043b\u044c, \u041a\u0430\u0440\u043b-\u0413\u0443\u0441\u0442\u0430\u0432\">\u041a\u0430\u0440\u043b\u0430 \u0413\u0443\u0441\u0442\u0430\u0432\u0430 \u0412\u0440\u0430\u043d\u0433\u0435\u043b\u044f<\/a> \u043d\u0430\u043d\u043e\u0441\u0438\u0442 \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0434\u0430\u0442\u0441\u043a\u043e\u043c\u0443 \u0444\u043b\u043e\u0442\u0443 \u0432 <a class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_Fehmarn_%281644%29\">\u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0438 \u043f\u0440\u0438 \u0424\u0435\u043c\u0430\u0440\u043d\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1775\" class=\"mw-redirect\" title=\"1775\">1775<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%BE%D0%B9_%D0%9A%D0%BE%D0%BD%D1%82%D0%B8%D0%BD%D0%B5%D0%BD%D1%82%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BD%D0%B3%D1%80%D0%B5%D1%81%D1%81\" title=\"\u0412\u0442\u043e\u0440\u043e\u0439 \u041a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0439 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\">\u0412\u0442\u043e\u0440\u043e\u0439 \u041a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0439 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441<\/a> \u043f\u0440\u0438\u043d\u044f\u043b \u0440\u0435\u0437\u043e\u043b\u044e\u0446\u0438\u044e \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%82%D0%B8%D0%BD%D0%B5%D0%BD%D1%82%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%84%D0%BB%D0%BE%D1%82\" title=\"\u041a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0439 \u0444\u043b\u043e\u0442\">\u041a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430<\/a>, \u0441\u0442\u0430\u0432\u0448\u0435\u0433\u043e \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D1%81%D0%B8%D0%BB%D1%8B_%D0%A1%D0%A8%D0%90\" title=\"\u0412\u043e\u0435\u043d\u043d\u043e-\u043c\u043e\u0440\u0441\u043a\u0438\u0435 \u0441\u0438\u043b\u044b \u0421\u0428\u0410\">\u0412\u043e\u0435\u043d\u043d\u043e-\u043c\u043e\u0440\u0441\u043a\u0438\u043c \u0444\u043b\u043e\u0442\u043e\u043c \u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1781_%D0%B3%D0%BE%D0%B4\" title=\"1781 \u0433\u043e\u0434\">1781<\/a>&#160;\u2014 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0439 \u0420\u0438\u043c\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BE%D1%81%