\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8B%D0%B9_%D0%B4%D0%BE%D0%BC\" title=\"\u0411\u0435\u043b\u044b\u0439 \u0434\u043e\u043c\">\u0411\u0435\u043b\u044b\u043c \u0434\u043e\u043c\u043e\u043c<\/a>\u00bb, \u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4\" title=\"1902 \u0433\u043e\u0434\">1902 \u0433\u043e\u0434\u0443<\/a> \u044d\u0442\u043e \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0437\u0434\u0430\u043d\u0438\u044f \u0431\u044b\u043b\u043e \u0443\u0437\u0430\u043a\u043e\u043d\u0435\u043d\u043e.<\/li><\/ul><h3><span class=\"mw-headline\" id=\"XIX_.D0.B2.D0.B5.D0.BA\"><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XIX_%D0%B2%D0%B5%D0%BA\" title=\"XIX \u0432\u0435\u043a\">XIX \u0432\u0435\u043a<\/a><\/span> <\/span><\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1805_%D0%B3%D0%BE%D0%B4\" title=\"1805 \u0433\u043e\u0434\">1805<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B9_%D0%BF%D1%80%D0%B8_%D0%AD%D0%BB%D1%8C%D1%85%D0%B8%D0%BD%D0%B3%D0%B5%D0%BD%D0%B5\" title=\"\u0411\u043e\u0439 \u043f\u0440\u0438 \u042d\u043b\u044c\u0445\u0438\u043d\u0433\u0435\u043d\u0435\">\u0431\u043e\u0439 \u043f\u0440\u0438 \u042d\u043b\u044c\u0445\u0438\u043d\u0433\u0435\u043d\u0435<\/a> \u0430\u0440\u043c\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430<\/a> (<span lang=\"fr\" style=\"font-style: italic\" xml:lang=\"fr\">Napol\u00e9on Bonaparte<\/span>) \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u0438\u043c\u0438<\/a> \u0432\u043e\u0439\u0441\u043