D1%8D%D0%B4%D1%83%D0%BD\" title=\"\u041c\u0430\u043e \u0426\u0437\u044d\u0434\u0443\u043d\">\u041c\u0430\u043e \u0426\u0437\u044d\u0434\u0443\u043d<\/a> (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">Mao Zedong<\/span>) \u0437\u0430\u044f\u0432\u0438\u043b: \u00ab\u041d\u0435 \u043d\u0430\u0434\u043e \u0447\u0438\u0442\u0430\u0442\u044c \u043c\u043d\u043e\u0433\u043e \u043a\u043d\u0438\u0433\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1958_%D0%B3%D0%BE%D0%B4\" title=\"1958 \u0433\u043e\u0434\">1958<\/a><ul><li>\u0422\u0440\u0443\u0434\u043e\u0432\u043e\u0439 \u043a\u043e\u043b\u043b\u0435\u043a\u0442\u0438\u0432 \u0441\u0442\u0430\u043d\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0-%D0%A1%D0%BE%D1%80%D1%82%D0%B8%D1%80%D0%BE%D0%B2%D0%BE%D1%87%D0%BD%D0%B0%D1%8F-%D0%9A%D0%B8%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430-\u0421\u043e\u0440\u0442\u0438\u0440\u043e\u0432\u043e\u0447\u043d\u0430\u044f-\u041a\u0438\u0435\u0432\u0441\u043a\u0430\u044f\">\u041c\u043e\u0441\u043a\u0432\u0430-\u0421\u043e\u0440\u0442\u0438\u0440\u043e\u0432\u043e\u0447\u043d\u0430\u044f<\/a> \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u043b \u043d\u0430\u0447\u0430\u0442\u044c \u0432\u0441\u0435\u0441\u043e\u044e\u0437\u043d\u043e\u0435 \u0441\u043e\u0440\u0435\u0432\u043d\u043e\u0432\u0430\u043d\u0438\u0435 \u0437\u0430 \u0437\u0432\u0430\u043d\u0438\u044f \u0431\u0440\u0438\u0433\u0430\u0434 \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0442\u0440\u0443\u0434\u0430.<\/li><li>\u041f\u0435\u0440\u0432\u0430\u044f \u043f\u0443\u0431\u043b\u0438\u043a\u0430\u0446\u0438\u044f \u043a\u043d\u0438\u0433\u0438 \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B4%D0%B2%D0%B5%D0%B6%D0%BE%D0%BD%D0%BE%D0%BA_%D0%9F%D0%B0%D0%B4%D0%B4%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD\" title=\"\u041c\u0435\u0434\u0432\u0435\u0436\u043e\u043d\u043e\u043a \u041f\u0430\u0434\u0434\u0438\u043d\u0433\u0442\u043e\u043d\">\u043c\u0435\u0434\u0432\u0435\u0436\u043e\u043d\u043a\u0435 \u041f\u0430\u0434\u0434\u0438\u043d\u0433\u0442\u043e\u043d\u0435<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1972_%D0%B3%D0%BE%D0%B4\" title=\"1972 \u0433\u043e\u0434\">1972<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-62_%D0%BF%D0%BE%D0%B4_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%BE%D0%B9_(1972)\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-62 \u043f\u043e\u0434 \u041c\u043e\u0441\u043a\u0432\u043e\u0439 (1972)\">\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u0418\u043b-62<\/a> \u0431\u043b\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u044b<\/a> \u043d\u0430 \u0431\u0435\u0440\u0435\u0433\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D0%BE%D0%B7%D0%B5%D1%80%D0%BE\" title=\"\u041d\u0435\u0440\u0441\u043a\u043e\u0435 \u043e\u0437\u0435\u0440\u043e\">\u041d\u0435\u0440\u0441\u043a\u043e\u0433\u043e \u043e\u0437\u0435\u0440\u0430<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 174 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430&#160;\u2014 \u043d\u0430 \u0442\u043e \u0432\u0440\u0435\u043c\u044f \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0430\u044f \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0432 \u043c\u0438\u0440\u0435. \u041f\u0440\u0438\u0447\u0438\u043d\u044b \u0442\u0440\u0430\u0433\u0435\u0434\u0438\u0438 \u043e\u0441\u0442\u0430\u043b\u0438\u0441\u044c \u043d\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B4%D1%8B\" title=\"\u0410\u043d\u0434\u044b\">\u0410\u043d\u0434\u0430\u0445<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D1%81%D0%B0%D0%BC%D0%BE%D0%BB%D0%B5%D1%82%D0%B0_FH-227_%D0%B2_%D0%90%D0%BD%D0%B4%D0%B0%D1%85\" class=\"mw-redirect\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0441\u0430\u043c\u043e\u043b\u0435\u0442\u0430 FH-227 \u0432 \u0410\u043d\u0434\u0430\u0445\">\u0440\u0430\u0437\u0431\u0438\u043b\u0441\u044f \u0441\u0430\u043c\u043e\u043b\u0435\u0442<\/a> \u0441 \u044e\u043d\u0438\u043e\u0440\u0441\u043a\u043e\u0439 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0439 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B3%D0%B1%D0%B8\" title=\"\u0420\u0435\u0433\u0431\u0438\">\u0440\u0435\u0433\u0431\u0438<\/a> \u0438\u0437 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%82%D0%B5%D0%B2%D0%B8%D0%B4%D0%B5%D0%BE\" title=\"\u041c\u043e\u043d\u0442\u0435\u0432\u0438\u0434\u0435\u043e\">\u041c\u043e\u043d\u0442\u0435\u0432\u0438\u0434\u0435\u043e<\/a>. \u0412\u044b\u0436\u0438\u043b\u0438 \u043b\u0438\u0448\u044c 16 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1975_%D0%B3%D0%BE%D0%B4\" title=\"1975 \u0433\u043e\u0434\">1975<\/a>&#160;\u2014 \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D1%8E%D0%B4%D0%BE,_%D0%9F%D1%8C%D0%B5%D1%80_%D0%AD%D0%BB%D0%B8%D0%BE%D1%82\" class=\"mw-redirect\" title=\"\u0422\u0440\u044e\u0434\u043e, \u041f\u044c\u0435\u0440 \u042d\u043b\u0438\u043e\u0442\">\u041f\u044c\u0435\u0440 \u0422\u0440\u044e\u0434\u043e<\/a> (<span lang=\"fr\" style=\"font-style: italic\" xml:lang=\"fr\">Pierre Elliott Trudeau<\/span>) \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u0447\u0440\u0435\u0437\u0432\u044b\u0447\u0430\u0439\u043d\u043e\u0433\u043e \u0442\u0440\u0451\u0445\u043b\u0435\u0442\u043d\u0435\u0433\u043e \u0430\u043d\u0442\u0438\u0438\u043d\u0444\u043b\u044f\u0446\u0438\u043e\u043d\u043d\u043e\u0433\u043e \u043f\u043b\u0430\u043d\u0430, \u043f\u0440\u0435\u0434\u0443\u0441\u043c\u0430\u0442\u0440\u0438\u0432\u0430\u044e\u0449\u0435\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c \u0446\u0435\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1976_%D0%B3%D0%BE%D0%B4\" title=\"1976 \u0433\u043e\u0434\">1976<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D0%BB%D1%8F%D0%B1%D0%B8%D0%BD%D1%81%D0%BA\" title=\"\u0427\u0435\u043b\u044f\u0431\u0438\u043d\u0441\u043a\">\u0427\u0435\u043b\u044f\u0431\u0438\u043d\u0441\u043a<\/a> \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D0%B0-%D0%BC%D0%B8%D0%BB%D0%BB%D0%B8%D0%BE%D0%BD%D0%B5%D1%80%D1%8B_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0413\u043e\u0440\u043e\u0434\u0430-\u043c\u0438\u043b\u043b\u0438\u043e\u043d\u0435\u0440\u044b \u0420\u043e\u0441\u0441\u0438\u0438\">\u0433\u043e\u0440\u043e\u0434\u043e\u043c-\u043c\u0438\u043b\u043b\u0438\u043e\u043d\u0435\u0440\u043e\u043c<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D1%82%D0%B0-%D0%9A%D1%80%D1%83%D1%81-%D0%B4%D0%B5-%D0%BB%D0%B0-%D0%A1%D1%8C%D0%B5%D1%80%D1%80%D0%B0\" title=\"\u0421\u0430\u043d\u0442\u0430-\u041a\u0440\u0443\u0441-\u0434\u0435-\u043b\u0430-\u0421\u044c\u0435\u0440\u0440\u0430\">\u0421\u0430\u043d\u0442\u0430-\u041a\u0440\u0443\u0441\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B8%D0%B2%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0438\u0432\u0438\u044f\">\u0411\u043e\u043b\u0438\u0432\u0438\u044f<\/a>) <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_Boeing_707_%D0%B2_%D0%A1%D0%B0%D0%BD%D1%82%D0%B0-%D0%9A%D1%80%D1%83%D1%81%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 Boeing 707 \u0432 \u0421\u0430\u043d\u0442\u0430-\u041a\u0440\u0443\u0441\u0435\">\u0441\u0430\u043c\u043e\u043b\u0451\u0442 Boeing 707 \u043f\u0440\u0438 \u0432\u0437\u043b\u0451\u0442\u0435 \u0443\u043f\u0430\u043b \u043d\u0430 \u0441\u0442\u0430\u0434\u0438\u043e\u043d<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 \u043d\u0435 \u043c\u0435\u043d\u0435\u0435 91 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430&#160;\u2014 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0430\u044f \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0432 \u0441\u0442\u0440\u0430\u043d\u0435.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990_%D0%B3%D0%BE%D0%B4\" title=\"1990 \u0433\u043e\u0434\">1990<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%80%D1%8C%D0%BA%D0%BE%D0%B2\" title=\"\u0425\u0430\u0440\u044c\u043a\u043e\u0432\">\u0425\u0430\u0440\u044c\u043a\u043e\u0432\u0435<\/a> \u0432 \u044d\u0444\u0438\u0440 \u0432\u044b\u0448\u043b\u0438 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u044b, \u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u043b\u0435\u043d\u043d\u044b\u0435 \u0441\u0442\u0443\u0434\u0438\u0435\u0439 \u0410\u0422\u0412-1, \u0432 \u0434\u0430\u043b\u044c\u043d\u0435\u0439\u0448\u0435\u043c \u0417\u0410\u041e \u0420\u0422\u041a \u00ab\u0422\u043e\u043d\u0438\u0441-\u0426\u0435\u043d\u0442\u0440\u00bb. \u042d\u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u0441\u0442\u0430\u043b \u0434\u043d\u0451\u043c \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u043d\u0435\u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0442\u0435\u043b\u0435\u0432\u0438\u0434\u0435\u043d\u0438\u044f.<\/li><\/ul><h3><span class=\"mw-headline\" id=\"XXI_.D0.B2.D0.B5.D0.BA\"><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XXI_%D0%B2%D0%B5%D0%BA\" title=\"XXI \u0432\u0435\u043a\">XXI \u0432\u0435\u043a<\/a><\/span> <\/span><\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2005_%D0%B3%D0%BE%D0%B4\" title=\"2005 \u0433\u043e\u0434\">2005<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%B0%D0%B4%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BD%D0%B0_%D0%9D%D0%B0%D0%BB%D1%8C%D1%87%D0%B8%D0%BA_(2005)\" title=\"\u041d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0435 \u043d\u0430 \u041d\u0430\u043b\u044c\u0447\u0438\u043a (2005)\">\u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0435 \u0438\u0441\u043b\u0430\u043c\u0438\u0441\u0442\u043e\u0432 \u043d\u0430 \u041d\u0430\u043b\u044c\u0447\u0438\u043a<\/a>.<\/li><\/ul>"}